import React from "react";

const Product = (id, name, brand, imgUrl, price, currency ) => {
    return (
        <div className=" mb-10">
                        <p>{id}</p>
                        <h2>{name} </h2>
                        <p>{brand} </p>
                        <img width='100' src={`https://${imgUrl}`} alt={name}  />
                        <p>
                            {price} {currency}
                        </p>
                </div>
    )
}

export default Product
